import React from 'react'
import Table from 'react-bootstrap/Table'

function Tables(header,columnData) {
   console.log(header)
  return (
    <Table striped bordered hover >
    <thead>
      {
        header.map((head)=>(
        <tr>
        <th>{head}</th>
        </tr>
        ))
      } 
    </thead>
    <tbody>
      {columnData.map((columns,index)=>(
        <tr>
        <td>{columns[index]}</td>
        </tr>
      ))}


    </tbody>
</Table>
  )
}

export default Tables;
